import React, {useState} from 'react';

// function App(){
//   return<h1>Hi</h1>

// }

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import NavBar from './components/NavBar';
import Homepage from './components/Homepage';
import ConsultForm from './components/ConsultForm';
import SafetyPlan from './components/SafetyPlanForm';
import ContactPage from './components/ContactPage';
import Testimonials from './components/Testimonials'
import SafetyPlanForm from './components/SafetyPlanForm';
import IdAbuse from './components/IdAbuse';
import NewsletterSignup from './components/Newsletter';
import './App.css';

function App() {
  const [completedSafetyPlan, setCompletedSafetyPlan] = useState([]);

  const handleSubmit = (formData)=>{
    fetch ('/generate_safety_plan',{
      method: 'POST',
      headers:{
        'Content-Type' : 'application/json'
      },
      body: JSON.stringify(formData),

    })
    .then((response)=> response.json())
    .then((data)=>{
      setCompletedSafetyPlan(data);
    }) 
  }

  return (

  <Router>
    //   <NavBar />
    //   <SafetyPlanForm onSubmit={handleSubmit}/>
    //   <Testimonials/>
    //   <ConsultForm/>
    //   <IdAbuse/>
    //   <NewsletterSignup/>


      <Routes> 
        <Route path="/" exact component={Homepage} />
        <Route path="/consult-form" component={ConsultForm} />
        <Route path="/safety-plan" component={SafetyPlan} />
        <Route path="/contact" component={ContactPage} />
        <Route path="/testimonials" component={Testimonials}/>
      </Routes>
   </Router>

  );
}

export default App;
